import React, { Component } from "react";
import Grid from "@material-ui/core/Grid";
import CommandList from "./CommandList";
import { withStyles } from "@material-ui/styles";
import Status from "./Status";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import DOA from "./DOA";
import Map from "./Map";
import { withScriptjs } from "react-google-maps";

const styles = theme => ({
  root: {
    flexGrow: 1
  },
  paper: {
    padding: theme.spacing.unit * 2,
    textAlign: "center",
    color: theme.palette.text.secondary
  }
});

class AppGrid extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    const MapLoader = withScriptjs(Map);

    const style = {
      padding: 24
    };
    return (
      <Grid container style={style} justify="center">
        <Grid item xs={12}>
          <Typography variant="h4" gutterBottom component="h2">
            Map
          </Typography>
          <Paper>
            <MapLoader
              googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyCJl7fJGVQIzKzjqfcSszowI79wuduqCTY"
              loadingElement={
                <div
                  alt="The map of your location"
                  style={{ height: `100%` }}
                />
              }
            />
          </Paper>
        </Grid>
        <Grid item style={{ paddingTop: 16 }} xs={8}>
          <Typography variant="h4" gutterBottom component="h2">
            Directions
          </Typography>
          <Paper>
            <DOA />
          </Paper>
        </Grid>
        <Grid item style={{ paddingTop: 16 }} xs={4}>
          <Typography variant="h4" gutterBottom component="h2">
            Status
          </Typography>
          <Paper>
            <Status />
          </Paper>
        </Grid>
        <Grid item xs={12}>
          <Typography
            style={{ paddingTop: 16 }}
            variant="h4"
            gutterBottom
            component="h2"
          >
            Commands
          </Typography>
          <CommandList commands={this.props.data} />
        </Grid>
      </Grid>
    );
  }
}

export default withStyles(styles)(AppGrid);
